    data: |
      SELECT ALL - + col0 + - 77 - + - 38 * + - col0 AS col1, + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 >= - - col0 * - + col0 + - col2;
  - name: tab2

outputs:
  - name: q8688.out
    data: |
